import React from "react";
import "./Header.css";
import { Link } from "react-router-dom";
import logo from "../../Assets/images/logo.svg"

const Header = (props) => {
  return (
    <div className="header__container">
      <header className="header">
        <img src={logo} className="header__logo" alt="" />
        <nav className="header__nav">
          <Link className="header__nav__link" href="" to="/">Home</Link>
          <Link className="header__nav__link" href="" to="EventsType">Event Types</Link>
          <Link className="header__nav__link" href="" to="EventsPage">Events</Link>
          <Link className="header__nav__link" href="" to="TestPage">Tests</Link>
        </nav>
        <span>
        <Link href="" to="Login">Login</Link>
        </span>
        
      </header>
    </div>
  );
};

export default Header;
